features.script:
let man = parcel.getFeatureById('man');

if(start && (Math.abs(start.x-man.position.x) > 5 || Math.abs(start.z-man.position.z)) > 5){
  man.position.x = start.x;
  man.position.z = start.z;
}else{
  if(!start){
    start = man.position;
  }
  console.log('rotation:', man.rotation);
  man.rotation.y+= (Math.random()-0.5)*1.57;

  let offsetX = Math.random() * 0.1 * speed;
  let offsetZ = Math.random() * 0.1 * speed;
  man.position.x += offsetX;
  man.position.z += offsetZ;
}
}, 500)
